import React, {Fragment} from "react";

const InputTodo = () => {
    return <Fragment>
            <h1 className="text-center mt-5">Input Todo</h1>
            <form >
                <input type="text" className="form-control"/>
                <button className="btn btn-green">Add</button>
            </form>
        </Fragment>
};

export default InputTodo;
